SET SQL_MODE="NO_AUTO_VALUE_ON_ZERO";
SET time_zone = "+00:00";

use u287541009_banco;

CREATE TABLE IF NOT EXISTS `Genero` (
  `id_Genero` int(11) NOT NULL AUTO_INCREMENT,
  `Nome` varchar(45) COLLATE utf8_unicode_ci NOT NULL,
  PRIMARY KEY (`id_Genero`)
) ENGINE=MyISAM  DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci AUTO_INCREMENT=5 ;



CREATE TABLE IF NOT EXISTS `Imagem` (
  `id_Imagem` int(11) NOT NULL AUTO_INCREMENT,
  `id_Postagem` int(11) NOT NULL,
  `Link` mediumtext COLLATE utf8_unicode_ci NOT NULL,
  PRIMARY KEY (`id_Imagem`),
  KEY `id_Postagem` (`id_Postagem`)
) ENGINE=MyISAM  DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci AUTO_INCREMENT=130 ;


CREATE TABLE IF NOT EXISTS `Postagem` (
  `id_Postagem` int(11) NOT NULL AUTO_INCREMENT,
  `Titulo` varchar(45) COLLATE utf8_unicode_ci NOT NULL,
  `Texto` mediumtext COLLATE utf8_unicode_ci NOT NULL,
  `Dia` date NOT NULL,
  `Curtidas` int(11) NOT NULL,
  `id_Usuario` int(11) NOT NULL,
  `id_Genero` int(11) NOT NULL,
  PRIMARY KEY (`id_Postagem`),
  KEY `id_Usuario` (`id_Usuario`),
  KEY `id_Genero` (`id_Genero`)
) ENGINE=MyISAM  DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci AUTO_INCREMENT=44 ;




CREATE TABLE IF NOT EXISTS `Usuario` (
  `id_Usuario` int(11) NOT NULL AUTO_INCREMENT,
  `Nome` varchar(45) COLLATE utf8_unicode_ci NOT NULL,
  `Senha` varchar(45) COLLATE utf8_unicode_ci NOT NULL,
  `Email` varchar(45) COLLATE utf8_unicode_ci NOT NULL,
  `Idade` int(11) NOT NULL,
  PRIMARY KEY (`id_Usuario`)
) ENGINE=MyISAM  DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci AUTO_INCREMENT=43 ;

